import LogOutButton from "./components/LogOutButton.tsx";
import LoginButton from "./components/LoginButton.tsx";

function Head()
{
    return (
        <header>
            <nav>
                <a href="http://localhost:3000/">Главная</a>
                {sessionStorage.accessToken ? <LoginButton /> : <LogOutButton />}
            </nav>
        </header>
    );
}
  export default Head;
